INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, "アヤネ", 24001, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 102301, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, "アヤネ", 24002, "2030/12/17 14:59:59", 2.21, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 102301, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, "アヤネ", 24003, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 102301, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, "アサヒ", 24004, "2030/12/17 14:59:59", 1.99, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192201, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, "アサヒ", 24005, "2030/12/17 14:59:59", 2.21, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192201, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, "アサヒ", 24006, "2030/12/17 14:59:59", 3.33, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192201, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, "部員３", 24007, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192301, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, "部員３", 24008, "2030/12/17 14:59:59", 2.68, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192301, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, "部員３", 24009, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192301, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "やった！", 501, "", 24010, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192501, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "勝ったよ！", 502, "", 24011, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192501, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "いい調子！", 503, "", 24012, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192501, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, "ミサト", 24013, "2030/12/17 14:59:59", 5.33, 6, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 113501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, "ミサト", 24014, "2030/12/17 14:59:59", 6.85, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 113501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, "ミサト", 24015, "2030/12/17 14:59:59", 3.0, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 113501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, "ダイチ", 24016, "2030/12/17 14:59:59", 6.11, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192401, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, "ダイチ", 24017, "2030/12/17 14:59:59", 6.75, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192401, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, "ダイチ", 24018, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192401, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, "ハツネ", 24019, "2030/12/17 14:59:59", 4.52, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 113401, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, "ハツネ", 24020, "2030/12/17 14:59:59", 3.89, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 113401, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, "ハツネ", 24021, "2030/12/17 14:59:59", 13.49, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 113401, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, "カヤ", 24022, "2030/12/17 14:59:59", 3.17, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 106501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, "カヤ", 24023, "2030/12/17 14:59:59", 4.42, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 106501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, "カヤ", 24024, "2030/12/17 14:59:59", 2.89, 6, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 106501, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, "アヤネ", 24025, "2030/12/17 14:59:59", 3.71, 4, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 102301, 3);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, "アサヒ", 24026, "2030/12/17 14:59:59", 5.1, 2, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192201, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, "部員３", 24027, "2030/12/17 14:59:59", 4.34, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192301, 3);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "いい勝負だったよ\nまたやろうね", 521, "", 24028, "2030/12/17 14:59:59", 0.0, 1, "2020/07/31 12:00:00", 0.0, 10046, 0.0, 192501, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, "ミサト", 24029, "2030/12/17 14:59:59", 5.62, 1, "2020/07/31 12:00:00", 0.0, 10046, -360.0, 113501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, "ミサト", 24030, "2030/12/17 14:59:59", 9.58, 1, "2020/07/31 12:00:00", 0.0, 10046, -360.0, 113501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, "ミサト", 24031, "2030/12/17 14:59:59", 0.0, 2, "2020/07/31 12:00:00", 0.0, 10046, -360.0, 113501, 2);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, "ミサト", 24032, "2030/12/17 14:59:59", 9.13, 2, "2020/07/31 12:00:00", 0.0, 10046, -360.0, 113501, 1);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, "ミサト", 24033, "2030/12/17 14:59:59", 8.27, 1, "2020/07/31 12:00:00", 0.0, 10046, -360.0, 113501, 2);
